import {BrowserRouter, Routes, Route} from "react-router-dom";
import P_home from "./pages/p_home";
import P_movies from "./pages/p_movies";
import P_about from "./pages/p_about";
import Home_p from "./pages/p_home";

function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={ <home_p /> } />
            <Route path="/movies" element={ <movies_p /> } />
            <Route path="/about" element={ <about_p /> } />
          <Route path="*" element={ <home_p /> } />
        </Routes>
      </BrowserRouter>
  );
}

export default App;
